        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header> */}
      <Navbar></Navbar>
      <Card 
        activity={activities.filter(activity => activity.name == 'Education')}
      ></Card>
      <Card 
        activity={activities.filter(activity => activity.name == 'Work')}
      ></Card>
      <footer className="footer"></footer>
    </div>
  );
}

export default App;
